@charset "UTF-8";
/* this file is only used to accomodate third party CSS*/
.image-gallery {
  -webkit-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  -o-user-select: none;
  user-select: none; }

.image-gallery-content {
